import React, { useState } from 'react'
import SubmitContext from './SubmitContext'

function SubmitState(props) {
    const[constData,setConstData] = useState("Hello from const");
    const handleSubmitContext = (data)=>
    {
        console.log("Data using COntext" , data);
    }
  return (
    <>
    <SubmitContext.Provider value={{handleSubmitContext , constData , setConstData}}>
        {props.children}
    </SubmitContext.Provider>
    </>
  )
}

export default SubmitState
